import { base_url } from "../config";

const NewPost = {
  new: (
    namePost,
    content,
    selectedCategory,
    mainimage,
    newName,
    slugify,
    datetime,
    schedule
  ) => {
    return fetch(`${base_url}/newpost`, {
      method: "post",
      headers: {
        "Content-type": "application/json",
      },
      body: JSON.stringify({
        name: namePost,
        content: content,
        category: selectedCategory,
        mainimage: mainimage,
        newness: newName,
        slug: slugify,
        datetime: datetime,
        publicpost: schedule,
      }),
    })
      .then((res) => res.json())
      .then((res) => {
        return res;
      });
  },
};

export default NewPost;
